import React, { useState, useEffect } from 'react';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField  from '@mui/material/TextField';
import Button from '@mui/material/Button/Button';
import TableContainer from '@mui/material/TableContainer/TableContainer';
import TableHead from '@mui/material/TableHead/TableHead';
import TableCell from '@mui/material/TableCell/TableCell';
import TableRow from '@mui/material/TableRow/TableRow';
import TableBody from '@mui/material/TableBody/TableBody';
import Table from '@mui/material/Table/Table';
import Paper from '@mui/material/Paper/Paper';
import Container from '@mui/material/Container/Container';

const rows = ["API 1", "API 2", "API 3", "API 4",];

export default function Home() {
  useEffect(()=>{
    fetch('http://localhost:5000/',{
      'methods':'GET',
      headers : {
        'Content-Type':'application/json'
      }
    })
    .then(response => response.json())
    .catch(error => console.log(error))

  },[])

  return (
    <Container maxWidth="sm">
      <Box>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <TextField id="outlined-basic" label="Number of apis" variant="outlined" />
          </Grid>
          <Grid item xs={4}>
            <Button variant="contained">Load</Button>
          </Grid>
          <Grid item xs={6}>
              <TableContainer component={Paper}>
                <Table sx={{ minWidth: 650 }} aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell>API Names</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {rows.map((row) => (
                      <TableRow
                        key={row}
                        sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                      >
                        <TableCell component="th" scope="row"> {row} </TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
        </TableContainer>
          </Grid>
          <Grid item xs={6}>
            <div>API definition</div>          
            <Paper variant="outlined">This is a definition</Paper>
          </Grid>
        </Grid>
      </Box>
    </Container>
  );
}
